import { Route, Routes, Navigate, useLocation } from "react-router-dom";
import Navbar from "./components/Navbar";
import Footer from "./components/Footer";
import Home from "./Pages/Home";
import Admportal from "./Pages/admportal";
import Collpred from "./Pages/Collpred";
import LoginForm from "./LoginPage";
import Neetpred from "./Pages/Neetpred";
import AdminDashboard from "./Admindashboard";
import { useState } from "react";

export default function App() {
  const [isLoggedIn, setIsLoggedIn] = useState(false); // Placeholder for actual login logic
  const location = useLocation();

  // Check if the current path is '/login'
  const isLoginPage = location.pathname === "/login";

  return (
    <div className="App">
      {/* Conditionally show Navbar and Footer if not on login page */}
      {!isLoginPage && <Navbar />}

      <Routes>
        {/* Public routes */}
        <Route path="/" element={<Navigate to="/home" />} />
        <Route path="/home" element={<Home />} />
        <Route path="/admportal" element={<Admportal />} />
        <Route path="/login" element={<LoginForm />} />

        {/* Protected routes */}
        {isLoggedIn ? (
          <>
            <Route path="/collpred" element={<Collpred />} />
            <Route path="/neetpred" element={<Neetpred />} />
            <Route path="/admin" element={<AdminDashboard />} />
          </>
        ) : (
          // Redirect to login if not logged in
          <>
            <Route path="/collpred" element={<Navigate to="/login" />} />
            <Route path="/neetpred" element={<Navigate to="/login" />} />
            <Route path="/admin" element={<Navigate to="/login" />} />
          </>
        )}
      </Routes>

      {/* Conditionally show Footer if not on login page */}
      {!isLoginPage && <Footer />}
    </div>
  );
}
